import coat from './coat.png';
import warmPuffer from './warm-puffer.png';
import bomber from './bomber.png';
import bikerJacket from './biker-jacket.png';
import denimJacket from './denim-jacket.png';
import blazer from './blazer.png';
import printed from './printed-checked.png';
import basicTees from './basic-tees.png';
import baseballTee from './baseball-tee.png';
import crewNeck from './crew-neck.png';

export const images = {
  coat,
  warmPuffer,
  bomber,
  bikerJacket,
  denimJacket,
  blazer,
  printed,
  basicTees,
  baseballTee,
  crewNeck
};
